syntax = "proto3";

package make87_messages_ros2.humble.ublox_ubx_msgs.msg;

import "make87_messages/core/header.proto";
import "make87_messages_ros2/humble/std_msgs/msg/header.proto";
import "make87_messages_ros2/humble/ublox_ubx_msgs/msg/cor_status_info.proto";

message UBXRxmCor {
    make87_messages.core.Header header = 1;
     make87_messages_ros2.humble.std_msgs.msg.Header ros2_header = 2;
     uint32 version = 3;
     uint32 ebno = 4;
     make87_messages_ros2.humble.ublox_ubx_msgs.msg.CorStatusInfo status_info = 5;
     uint32 msg_type = 6;
     uint32 msg_sub_type = 7;
}
